import React from "react";
import "./Portfolio.css";

const Portfolio = () => {
  const projects = [
    { id: 1, name: "Project 1", logo: "logo1.png", link: "#" },
    { id: 2, name: "Project 2", logo: "logo2.png", link: "#" },
    { id: 3, name: "Project 3", logo: "logo3.png", link: "#" },
  ];

  return (
    <div className="portfolio">
      {projects.map((project) => (
        <a key={project.id} href={project.link} className="portfolio-item">
          <img src={project.logo} alt={project.name} />
        </a>
      ))}
    </div>
  );
};

export default Portfolio;
